              className="read-box"
              value={this.state.readValuePD3}
              onChange={this.handleReadValChange}
            />
          </li>
        </ul>
        <label className="left-text-read">Read</label>
        <ul className="right-read-value-list">
          <li>
            <input
              size="1"
              type="text"
              className="read-box"
              value={this.state.readValuePD4}
              onChange={this.handleReadValChange}
            />
          </li>
          <li>
            <input
              size="1"
              type="text"
              className="read-box"
              value={this.state.readValuePD4}
              onChange={this.handleReadValChange}
            />
          </li>
          <li>
            <input
              size="1"
