              className="read-box"
              value={this.state.readValuePD4}
              onChange={this.handleReadValChange}
            />
          </li>
          <li>
            <input
              size="1"
              type="text"
              className="read-box"
              value={this.state.readValuePD4}
              onChange={this.handleReadValChange}
            />
          </li>
          <li>
            <input
              size="1"
              type="text"
              className="read-box"
              value={this.state.readValuePD4}
              onChange={this.handleReadValChange}
            />
          </li>
          <li>
            <input
              size="1"
              type="text"
              className="read-box"
              value={this.state.readValuePD4}
              onChange={this.handleReadValChange}
            />
          </li>
        </ul>
      </div>
    );
  }
}
export default ReadValue;
